import React from 'react';
import ReactDom from 'react-dom';
// import App from './App'
import add,{sub,mul,div} from "./Cal"; 


ReactDom.render(
<>
  <ol>
    <li>addition       : {add(6,7)}</li>
    <li>SubStraction   :{sub(4,2)}</li>
    <li>Multilplaction :{mul(3,6)} </li>
    <li>Division       : {div(4,1)}</li>
  </ol>
</>
  ,
  document.getElementById("root")
)
